    const { val } = useSelector((state) => state.toggle);
  return (<>

  <div className={`Holiday-Container ${val ? "activate" : ""}`}>
  <div className='Holidays-calendar'>
    <div className='Add-Holiday-btn'>
        
    </div>
  </div>
    <div className='timeline'>
        <Timeline />
    </div>
  </div>
  
  </>);
};

export default Holidays;
